	function $$$(node, customDictionary) {

		const _self = {}
		_self.i = node
		_self.learned = []



		_self.addText = function(formatting, text) {

			const wordArray = text.replace(",", "").replace(".", "").split(" ")
			let curParagraph = document.createElement('p')
			curParagraph.setAttribute("align", formatting) // To be customized in future features
			let word = null;
			
			for (word of wordArray){
				const curElement = document.createElement('spam')
				curElement.innerText = word + " " 
				curElement.id = word.trim() // Will be needed in future features, needs to become unique
				curElement.addEventListener('dblclick', define);
				curParagraph.appendChild(curElement)
				if (word === '\n'){
					_self.i.appendChild(curParagraph)
					curParagraph = document.createElement('p')
					curParagraph.setAttribute("align", "justify") // To be customized in future features
				}
			}
			if(word !== '\n'){
				_self.i.appendChild(curParagraph)
			}
		}

		if(customDictionary){
			dictionaryInUse = customDictionary 

		}
		else{
			// Default dictionary
			dictionaryInUse = frenchEnglishDict
		}

		// console.log(dictionaryInUse)
		
		currentInsertionPoint = _self.i
		return _self
	}


