	function replaceByDef(e, definition){

		if(definition){
			
			const termElement = e.target
			termElement.original = termElement.innerText
			termElement.innerText = definition + " "
			termElement.removeEventListener("dblclick", define)
			termElement.addEventListener("dblclick", revertToOriginal)
			termElement.style.color = "green"

		}

	}



	function revertToOriginal(e){

		const termElement = e.target
		termElement.innerText = termElement.original
		termElement.removeEventListener("dblclick", revertToOriginal)
		termElement.addEventListener("dblclick", define)
		termElement.style.color =  "black"

	}






















